  false,\n\t\"url\": null,\n\t\"notes\": \"This narrative report for Valentine NWR
  outlines Refuge accomplishments from May through August of 1961. The report begins
  by summarizing the weather conditions, habitat conditions, water conditions, and
  food and cover during this period. Wildlife- including migratory birds, upland game
  birds, big game animals, furbearers, predators, rodents, mammals, raptors, reptiles,
  and fish- is also covered. The Refuge development and maintenance section discusses
  physical developments, plantings, and vegetation control. Resource management is
  outlined; topics include grazing and haying. A progress report on field investigations
  and applied research is also provided. The public relations section of the report
  describes recreational uses, Refuge visitors, Refuge participation, fishing, and
  violations. Items of interest, N-R forms, and photographs are attached.\",\n\t\"license_title\":
